import { extendTheme, ChakraProvider } from '@chakra-ui/react';

import Cart from './Components/CartList';
import FoodsCategories from './Components/FoodsCategories';
import FoodsList from './Components/FoodsList';

function App() {
  return (
    <ChakraProvider>
    <div className="App">
      <FoodsList />
      <FoodsCategories />
      <Cart />
    </div>
    </ChakraProvider>
  );
}

export default App;
